    data: |
      pragma pg
      SELECT ALL - - col2 / 83 AS col2 FROM tab2 WHERE NOT - col2 * + - 59 + + - COALESCE ( col0, - 38 ) * - col1 * + col0 + + 56 * col2 * NULLIF ( col1, + 99 ) + - col1 + + 62 * - 16 IS NOT NULL GROUP BY col2;
  - name: tab2

outputs:
  - name: q6533.out
    data: |
